import React from 'react';
import { View, Text, ImageBackground, Image, TouchableOpacity } from 'react-native';

export default function Profile(props) {
    return (
        <View>
            <Image source={{uri: "data:image/jpeg;base64,"}}
             style={{height: 150, width: 370, marginRight: 100}}></Image>
            <View>
                <Text style={{marginTop: 50, marginLeft: 50, fontSize: 20, color: 'grey'}}>Full Name:</Text>
                <Text style={{marginTop: 20, marginLeft: 50, fontSize: 20, color: 'grey'}}>Email:</Text>
                <Text style={{marginTop: 20, marginLeft: 50, fontSize: 20, color: 'grey'}}>Password:</Text>
                <Text style={{marginTop: 20, marginLeft: 50, fontSize: 20, color: 'grey'}}>Phone Number:</Text>
                <Text style={{marginTop: 20, marginLeft: 50, fontSize: 20, color: 'grey'}}>Country, City:</Text>
                <Text style={{marginTop: 20, marginLeft: 50, fontSize: 20, color: 'grey'}}>Qualification:</Text>
                <TouchableOpacity activeOpacity={0.8} onPress={()=> alert("Updated")} style={{backgroundColor: '#C0C0C0', borderRadius: 50,width: 180, height: 40, marginLeft: 90, marginTop: 30}}>
                <Text style={{fontSize: 20, color: 'white', textAlign: 'center', marginTop: 5}}>Update Details</Text>
            </TouchableOpacity>
            </View>
        </View>
    )
}
